import React from 'react'
import api from '../../api'
import Navbar from '../../components/navbar'

export default function Home() {

  function onLoad(){
    api.get("/authenticate", {withCredentials:true})
    .then(res=>{
      console.log(res.data);
    })
    .catch(err=>{
      console.log(err.response.status);
    })
  }

  onLoad();

  return (
    <Navbar />
  )
}
